            <h3 class=""medium_heading""> II. PEDAGOGICAL OBJECTIVES    </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origin of the program </h3>
                <p class=""description""> 
                    Inherent in human nature, poorly managed conflict hinders the development of the protagonists and of society as a whole. Committed to conflict
                    management and the pacification of social relations, many public and private organizations need competent managers in conflict management in
                    general, and nonviolent conflict management in particular. The Conflict Management and Peace Building course empowers students and
                    strengthens their skills in conflict management, security strategies and im");
            WriteLiteral(@"plementation of peace promotion projects.
                </p>
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Objectives of the program </h3>
                <h3 class=""smaller_heading""> II.2.1. General Objectives </h3>
                <p class=""description""> 
                    The Master’s Program in Conflict Management and Peace Building (CMPB) aims to prepare students to meet the highest standards of
                    professional excellence in the fields of gender, peace and security, prevention, conflict management and resolution, peace negotiation and
                    security management.
                </p>

                <h3 class=""smaller_heading""> II.2.2. Specific Objectives </h3>
                <p class=""description""> 
                    <strong> Commun to the mention </strong><br/>
                    The specific objectives of the Conflict Management and Peace Building course are to :
                </p>");
