                <ul class=""one_list"">
                    <li> Improve understanding of conflict management mechanisms. </li>
                    <li> Design and develop peace strategies. </li>
                    <li> Familiarize with negotiation and mediation. </li>
                    <li> Develop skills in the implementation of conflict management and peace building projects and programs. </li>
                </ul>

                <h3 class=""small_heading""> II.3. Program Approach </h3>
                <p class=""description""> 
                    The program of the Master in Conflict and Peace Management, is designed for two academic years from the bachelor’s degree to obtain the
                    Master’s degree. At the end of the study, students must defend a Personal Professional Project before the jury in order to get their diploma.
                </p>

            </div>

